import React from "react";
import './styles.css'

const Dropdown = ({customStyle}) => {
return(
      <div className="dropdown-container" style={customStyle}>
            <div className="dropdown-"></div>
            <p>All Shipment</p>
            <p>Ready</p>
            <p>Active</p>
            <p>Completed</p>

      </div>
)
}

export default Dropdown
